import React from 'react';
import FiltroNumerico from './FiltrosNumericos';

class Headers extends React.Component {
  render() {
    return (
      <div>
        <div>
          <FiltroNumerico />
        </div>
        <thead>
          <tr>
            <th>name</th>
            <th>rotation_period</th>
            <th>orbital_period</th>
            <th>diameter</th>
            <th>climate</th>
            <th>gravity</th>
            <th>terrain</th>
            <th>surface_water</th>
            <th>population</th>
            <th>films</th>
            <th>created</th>
            <th>edited</th>
            <th>url</th>
          </tr>
        </thead>
      </div>
    );
  }
}

export default Headers;
